import React, { Component } from "react"
import API from "../../utils/API"
import { InputGroup, FormControl, Container, Button, Row, Col } from 'react-bootstrap'
import "./signIn.sass"

export default class User extends Component {

  state = {
    pageData: this.props.pageData,
    history: this.props.history,
    site_state: this.props.site_state,
    username: "",
    email: "",
    password: "",
    confirm: "",
    users: [],
    focus: "username"
  }

  componentDidMount(){
    console.log(this.state)
    this.getUsers()
  }

  getUsers(){
    API.getUsers()
      .then(res => {
        console.log('all users', res.data)
        this.setState({users: res.data})
      })
      .catch(err => console.log(err))
  }

  handleInputChange = (event) => {
    this.setState({[event.target.name]: event.target.value})
  }

  createUser = (event) => {
    if (this.state.confirm !== this.state.password) {
      alert("your password and your confirm password did not match")
      this.setState({password: "", confirm: ""})
    } else {
      console.log('ok GO', this.state)
    }
    // API.getUsers()
    //   .then(res => {
    //     console.log('all users', res.data)
    //     this.setState({users: res.data})
    //   })
    //   .catch(err => console.log(err))
  }

  render(){
    return (
      <div className="signin">

        <Button onClick={this.state.history.goBack}
          className="back-btn"
          variant="outline text-secondary">
          Back
        </Button>

        <br />
        <h1 className="text-secondary">
          {this.state.pageData.title}
        </h1>
        <br />

        <Container>
          <Row className="justify-content-md-center">
            <Col lg="6">

              <InputGroup size="lg" className="input">
                <InputGroup.Prepend >
                  <InputGroup.Text id="inputGroup-sizing-lg"
                  className="bg-secondary text-primary input-label border-light" >
                    User Name:
                  </InputGroup.Text>
                </InputGroup.Prepend>
                <FormControl
                  className="bg-light border-light"
                  name="username"
                  onChange={this.handleInputChange}
                  value={this.state.username}
                  autoFocus={this.state.focus === "username"}
                />
              </InputGroup>

              <InputGroup size="lg" className="input">
                <InputGroup.Prepend>
                  <InputGroup.Text id="inputGroup-sizing-lg"
                    className="bg-secondary text-primary input-label border-light" >
                    Email:
                  </InputGroup.Text>
                </InputGroup.Prepend>
                <FormControl
                  className="bg-light border-light"
                  name="email"
                  value={this.state.email}
                  onChange={this.handleInputChange}
                />
              </InputGroup>

              <InputGroup size="lg" className="input">
                <InputGroup.Prepend>
                  <InputGroup.Text id="inputGroup-sizing-lg"
                    className="bg-secondary text-primary input-label border-light" >
                    Password:
                  </InputGroup.Text>
                </InputGroup.Prepend>
                <FormControl
                  className="bg-light border-light"
                  name="password"
                  value={this.state.password}
                  onChange={this.handleInputChange}
                  autoFocus={this.state.focus === "password"}
                />
              </InputGroup>

              <InputGroup size="lg" className="input">
                <FormControl
                  placeholder="...Confirm Password"
                  className="bg-light border-light"
                  name="confirm"
                  value={this.state.confirm}
                  onChange={this.handleInputChange}
                />
              </InputGroup>

              <hr/>

              <Button size="lg" variant="primary text-dark" className="w-100"
                onClick={this.createUser}>
                Sign In
              </Button>


            </Col>
          </Row>
        </Container>

        <br />
        <hr />
        <br />

        <Button size="lg" variant="outline-primary text-dark" className="w-25"
          onClick={this.createUser}>
          New ? Sign Up
        </Button>

        <br /><br />

      </div>
    )
  }

}
